import React, { useState } from 'react';
import { Search, ShoppingCart, User, ChevronDown } from 'lucide-react';

const CategoryPage = () => {
  const [searchQuery, setSearchQuery] = useState('');

  const mainCategories = [
    {
      title: "Grocery & Kitchen",
      items: [
        { name: "Fruits & Vegetables", image: "/api/placeholder/200/200" },
        { name: "Dairy, Bread & Eggs", image: "/api/placeholder/200/200" },
        { name: "Atta, Rice & Pulses", image: "/api/placeholder/200/200" },
        { name: "Masala & Dry Fruits", image: "/api/placeholder/200/200" },
        { name: "Breakfast & Sauces", image: "/api/placeholder/200/200" },
        { name: "Packaged Foods", image: "/api/placeholder/200/200" }
      ]
    },
    {
      title: "Snacks & Beverages",
      items: [
        { name: "Tea & Coffee", image: "/api/placeholder/200/200" },
        { name: "Cold Drinks & Juices", image: "/api/placeholder/200/200" },
        { name: "Biscuits & Cookies", image: "/api/placeholder/200/200" },
        { name: "Chips & Namkeen", image: "/api/placeholder/200/200" },
        { name: "Ice Creams", image: "/api/placeholder/200/200" },
        { name: "Frozen Foods", image: "/api/placeholder/200/200" }
      ]
    },
    {
      title: "Household Essentials",
      items: [
        { name: "Home Needs", image: "/api/placeholder/200/200" },
        { name: "Cleaning Essentials", image: "/api/placeholder/200/200" },
        { name: "Kitchen & Appliances", image: "/api/placeholder/200/200" },
        { name: "Pet Care", image: "/api/placeholder/200/200" },
        { name: "Stationery", image: "/api/placeholder/200/200" },
        { name: "Tools & Storage", image: "/api/placeholder/200/200" }
      ]
    },
    {
      title: "Beauty & Personal Care",
      items: [
        { name: "Makeup & Beauty", image: "/api/placeholder/200/200" },
        { name: "Skin Care", image: "/api/placeholder/200/200" },
        { name: "Hair Care", image: "/api/placeholder/200/200" },
        { name: "Bath & Body", image: "/api/placeholder/200/200" },
        { name: "Grooming", image: "/api/placeholder/200/200" },
        { name: "Health & Wellness", image: "/api/placeholder/200/200" }
      ]
    }
  ];

  const deals = [
    { category: "Electronics", discount: "95% Off", image: "/api/placeholder/300/200" },
    { category: "Fashion", discount: "90% Off", image: "/api/placeholder/300/200" },
    { category: "Kitchen", discount: "70% Off", image: "/api/placeholder/300/200" },
    { category: "Beauty", discount: "50% Off", image: "/api/placeholder/300/200" },
    { category: "Home", discount: "40% Off", image: "/api/placeholder/300/200" }
  ];

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header */}
      <header className="bg-white shadow-sm">
        <div className="container mx-auto px-4 py-3">
          <div className="flex items-center justify-between">
            <div className="flex items-center space-x-8">
              <h1 className="text-2xl font-bold text-purple-600">QuickMart</h1>
              <div className="flex items-center space-x-2">
                <span>Delivery in</span>
                <span className="font-semibold">10 mins</span>
                <ChevronDown className="h-4 w-4" />
              </div>
            </div>
            
            <div className="flex-1 max-w-2xl mx-8">
              <div className="relative">
                <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400" />
                <input
                  type="text"
                  placeholder="Search for groceries, electronics, etc"
                  className="w-full pl-10 pr-4 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-purple-500"
                  value={searchQuery}
                  onChange={(e) => setSearchQuery(e.target.value)}
                />
              </div>
            </div>

            <div className="flex items-center space-x-6">
              <button className="flex items-center space-x-2">
                <User className="h-5 w-5" />
                <span>Login</span>
              </button>
              <button className="flex items-center space-x-2">
                <ShoppingCart className="h-5 w-5" />
                <span>Cart</span>
              </button>
            </div>
          </div>
        </div>
      </header>

      <main className="container mx-auto px-4 py-6">
        {/* Deals Section */}
        <section className="mb-12">
          <h2 className="text-2xl font-bold mb-6">New In Store</h2>
          <div className="grid grid-cols-1 md:grid-cols-3 lg:grid-cols-5 gap-4">
            {deals.map((deal, index) => (
              <div key={index} className="bg-white rounded-lg overflow-hidden shadow-sm hover:shadow-md transition-shadow">
                <div className="relative">
                  <img src={deal.image} alt={deal.category} className="w-full h-40 object-cover" />
                  <div className="absolute top-3 left-3 bg-purple-100 text-purple-700 px-3 py-1 rounded-full">
                    <span className="font-semibold">{deal.discount}</span>
                  </div>
                </div>
                <div className="p-4">
                  <h3 className="text-lg font-semibold">{deal.category}</h3>
                </div>
              </div>
            ))}
          </div>
        </section>

        {/* Category Sections */}
        {mainCategories.map((section, sectionIndex) => (
          <section key={sectionIndex} className="mb-12">
            <h2 className="text-2xl font-bold mb-6">{section.title}</h2>
            <div className="grid grid-cols-2 md:grid-cols-4 lg:grid-cols-6 gap-4">
              {section.items.map((item, itemIndex) => (
                <div key={itemIndex} className="bg-white rounded-lg overflow-hidden shadow-sm hover:shadow-md transition-shadow cursor-pointer">
                  <div className="p-4">
                    <img src={item.image} alt={item.name} className="w-full h-32 object-cover rounded-lg mb-4" />
                    <h3 className="text-center text-sm font-medium">{item.name}</h3>
                  </div>
                </div>
              ))}
            </div>
          </section>
        ))}
      </main>
    </div>
  );
};

export default CategoryPage;
